package main

import (
	"strings"
)

// Given a string of words, return a list of words split on whitespace, if no whitespaces exists in the text you
// should split on commas ',' if no commas exists you should return the number of lower-case letters with odd order in the
// alphabet, ord('a') = 0, ord('b') = 1, ... ord('z') = 25
// Examples
// SplitWords("Hello world!") ➞ ["Hello", "world!"]
// SplitWords("Hello,world!") ➞ ["Hello", "world!"]
// SplitWords("abcdef") == 3
func SplitWords(txt string) interface{} {
	// First, check if there are whitespaces
	if strings.ContainsAny(txt, " \t\n\r") {
		return strings.Fields(txt)
	}

	// Second, check if there are commas
	if strings.Contains(txt, ",") {
		return strings.Split(txt, ",")
	}

	// Third, count lowercase letters with odd order in the alphabet
	count := 0
	for _, ch := range txt {
		if ch >= 'a' && ch <= 'z' {
			// ord('a') = 0, ord('b') = 1, ..., ord('z') = 25
			ord := int(ch - 'a')
			// Check if odd
			if ord%2 == 1 {
				count++
			}
		}
	}

	return count
}
